" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Epidural hematoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 347px; height: 358px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This large temporal epidural hematoma is associated with midline shift and compression of the ventricular system. The dark swirls within the hematoma represent rapid arterial bleeding.",
