var title_f25_52_26433="ECG sustained monomorphic VT";
var content_f25_52_26433=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F69201&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F69201&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    12 lead ECG of sustained monomorphic ventricular tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 431px; height: 416px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are the six precordial ECG leads (V1-V6). The QRS complex is wide and bizarre and the rhythm is ventricular tachycardia (VT). The sixth (+) and seventh (*) QRS complexes show a change in morphology, resembling a normal QRS complex; these represent fusion beats, with partial (+) or complete (*) normalization of the QRS complex. The seventh QRS complex (*) is preceded by a distinct P wave, which is probably conducted, capturing the ventricle for one beat, but not terminating the VT; this is also known as a Dresseler beat.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission by Samuel Levy, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
