" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Hepatic cystadenocarcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 365px; height: 279px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panel A: CT scan, during a percutaneous aspiration. Note irregular thick cyst wall with nonhomogenous content. Panel B: Gross pathological examination, revealing a thick wall with multiple papillary projections. Panel C: Histologic examination: Scanning magnification showing complex glandular structures embedded in the stroma of the wall (hematoxylin and eosin, original magnification: x 400). Panel D: Higher power demonstrates glands with a cribriform growth pattern and nuclei displaying mild atypia (hematoxylin and eosin, original magnification: x 2000).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
