var title_f25_52_26444="Adverse effects - TB and HIV medicines";
var content_f25_52_26444=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F53563&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F53563&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Common side effects shared by antiretrovirals and antituberculosis medications",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antiretrovirals",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antituberculosis medications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatitis",
"       </td>",
"       <td>",
"        <p>",
"         Nevirapine",
"        </p>",
"        <p>",
"         Ritonavir-boosted protease inhibitors",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Isoniazid",
"        </p>",
"        <p>",
"         Rifampin*",
"        </p>",
"        <p>",
"         Pyrazinamide",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gastrointestinal distress",
"       </td>",
"       <td>",
"        All antiretrovirals (less common with lamivudine and emtricitabine)",
"       </td>",
"       <td>",
"        <p>",
"         Fluoroquinolones",
"        </p>",
"        <p>",
"         Ethionamide (associated with taste alteration)",
"        </p>",
"        <p>",
"         Para-amniosalicylic acid",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nephrotoxicity",
"       </td>",
"       <td>",
"        <p>",
"         Tenofovir (renal tubular disfunction)",
"        </p>",
"        <p>",
"         Idinavir-ritonavir",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Aminoglycosides (nephrotoxic TB agents carry particular risk of potentiating lactic acidosis common to the NRTIs used in antiretroviral rollout regimens)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neuropsychiatric disorders",
"       </td>",
"       <td>",
"        Efavirenz (insomnia, drowsiness, vivid dreams)",
"       </td>",
"       <td>",
"        <p>",
"         Cycloserine (headaches, tremor, seizure)",
"        </p>",
"        <p>",
"         Terizidone (mainly headache and seizures)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Peripheral neuropathy",
"       </td>",
"       <td>",
"        <p>",
"         Stavudine",
"        </p>",
"        <p>",
"         Didanosine",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Cycloserine",
"        </p>",
"        <p>",
"         Streptomycin",
"        </p>",
"        <p>",
"         Amnioglycosides",
"        </p>",
"        <p>",
"         Isoniazid (overcome with pyridoxine administration)",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Stavudine, didanosine, tenofovir, lamivudine and emtricitabine are NRTIs. Nevirapine and efavirenz are NNRTIs. Idinavir and ritonovir are protease inhibitors. Common global rollout antiretroviral regimens: (stavudine or zidovidine) + (lamivudine or emtricitabine) + (nevirapine or efavirenz) or (tenofovir or abacavir) + (lamivudine or emtricitabine) + (nevirapine or efavirenz).",
"    <div class=\"footnotes\">",
"     MDR: multidrug resistant; NNRTIs: nonnuceloside reverse transcriptase inhibitors; NRTIs: nucleoside reverse transcriptase inhibitors; TB: tuberculosis; XDR: extensively drug-resistant.",
"     <br>",
"      * Rifampin induction of cytochrome P450 reduces serum levels of NNRTIs and protease inhibitors but is not therapeutically relevant for MDR/XDR TB.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Modified with permission from: Shenoi S, Heysell SK, Moll AP, Friedland G. Multi-drug Resistant and Extensively Drug-Resistant Tuberculosis: Consequences for the Global HIV Community. Curr Opin Infect Dis 2009; 22:11. Copyright &copy; 2009 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
