var title_f25_52_26445="TNM staging bladder CA";
var content_f25_52_26445=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F53395&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F53395&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    TNM staging system for bladder cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Primary tumor (T)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       TX",
"      </td>",
"      <td colspan=\"3\" rowspan=\"1\">",
"       Primary tumor cannot be assessed",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T0",
"      </td>",
"      <td colspan=\"3\">",
"       No evidence of primary tumor",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ta",
"      </td>",
"      <td colspan=\"3\">",
"       Noninvasive papillary carcinoma",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Tis",
"      </td>",
"      <td colspan=\"3\">",
"       Carcinoma in situ: \"flat tumor\"",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T1",
"      </td>",
"      <td colspan=\"3\">",
"       Tumor invades subepithelial connective tissue",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       T2",
"      </td>",
"      <td class=\"sublist_other_start\" colspan=\"3\">",
"       Tumor invades muscularis propria",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       pT2a",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Tumor invades superficial muscularis propria (inner half)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       pT2b",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Tumor invades deep muscularis propria (outer half)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       T3",
"      </td>",
"      <td class=\"sublist_other_start\" colspan=\"3\">",
"       Tumor invades perivesical tissue",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       pT3a",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Microscopically",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       pT3b",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Macroscopically (extravesical mass)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       T4",
"      </td>",
"      <td class=\"sublist_other_start\" colspan=\"3\">",
"       Tumor invades any of the following: prostatic stroma, seminal vesicles, uterus, vagina, pelvic wall, abdominal wall",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       T4a",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Tumor invades prostatic stroma, uterus, vagina",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       T4b",
"      </td>",
"      <td class=\"sublist_other\" colspan=\"3\">",
"       Tumor invades pelvic wall, abdominal wall",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Regional lymph nodes (N)*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       NX",
"      </td>",
"      <td colspan=\"3\">",
"       Lymph nodes cannot be assessed",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N0",
"      </td>",
"      <td colspan=\"3\">",
"       No lymph node metastasis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N1",
"      </td>",
"      <td colspan=\"3\">",
"       Single regional lymph node metastasis in the true pelvis (hypogastric, obturator, external iliac, or presacral lymph node)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N2",
"      </td>",
"      <td colspan=\"3\">",
"       Multiple regional lymph node metastasis in the true pelvis (hypogastric, obturator, external iliac, or presacral lymph node metastasis)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N3",
"      </td>",
"      <td colspan=\"3\">",
"       Lymph node metastasis to the common iliac lymph nodes",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Distant metastasis (M)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       M0",
"      </td>",
"      <td colspan=\"3\">",
"       No distant metastasis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       M1",
"      </td>",
"      <td colspan=\"3\">",
"       Distant metastasis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Anatomic stage/prognostic groups",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage 0a",
"      </td>",
"      <td>",
"       Ta",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage 0is",
"      </td>",
"      <td>",
"       Tis",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage I",
"      </td>",
"      <td>",
"       T1",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Stage II",
"      </td>",
"      <td>",
"       T2a",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T2b",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Stage III",
"      </td>",
"      <td>",
"       T3a",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T3b",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T4a",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Stage IV",
"      </td>",
"      <td>",
"       T4b",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Any T",
"      </td>",
"      <td>",
"       N1-3",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Any T",
"      </td>",
"      <td>",
"       Any N",
"      </td>",
"      <td>",
"       M1",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Note: cTNM is the clinical classification, pTNM is the pathologic classification.",
"    <div class=\"footnotes\">",
"     * Regional lymph nodes include both primary and secondary drainage regions. All other nodes above the aortic bifurcation are considered distant lymph nodes.",
"    </div>",
"    <div class=\"reference\">",
"     Used with the permission of the American Joint Committee on Cancer (AJCC), Chicago, Illinois. The original source for this material is the AJCC Cancer Staging Manual, Seventh Edition (2010) published by Springer New York, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
